import React, { Component } from 'react';
import { Link } from 'react-router-dom'
import axios from 'axios'
import '../css/Nav.css'

export class Nav extends Component {
    state = {
        menu: [],
        isLoaded: false
    }
    componentDidMount() {

        axios.get('/wordpress/wp-json/menus/v1/menus/menu1')
            .then(res => this.setState({
                menu: res.data.items,
                isLoaded: true
            })
            )
            .catch(err => console.log(err));
    }
    render() {
        const { menu, isLoaded } = this.state;

        if (isLoaded) {
            return (
                <div className="gx-main-header">
                    <header class="main-header">
                        <div class="row">
                            <div class="col-12">
                                <div class="gx-container">
                                    <div class="gx-toolbar menu">


                                        <a class="site-logo" href="/profilo">
                                            {/* <img src="/static/images/logo.png" alt="Bplanner" title="Bplanner"> */}
                                        </a>



                                        <ul class="quick-menu header-notifications ml-auto">

                                            <li class="nav-searchbox dropdown d-inline-block d-sm-none">
                                                <a href="javascript:void(0)" data-toggle="dropdown" aria-haspopup="true"
                                                    class="d-inline-block icon-btn" aria-expanded="false">
                                                    <i class="zmdi zmdi-search zmdi-hc-fw"></i>
                                                </a>
                                                <div aria-hidden="true"
                                                    class="p-0 dropdown-menu dropdown-menu-right search-bar right-side-icon search-dropdown">
                                                    <div class="form-group">

                                                        <button class="search-icon"><i
                                                            class="zmdi zmdi-search zmdi-hc-lg"></i></button>
                                                    </div>
                                                </div>
                                            </li>




                                        </ul>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </header>
                    <nav>
                        <ul className="nav-links">
                            <Link to={'/'}>
                                <h3>Bplanner</h3>
                            </Link>
                            {menu.map(ele => (
                                <Link to={ele.title}>
                                    <li>{ele.title}</li>

                                </Link>

                            ))}


                        </ul>

                    </nav>
                </div>
            )


        }
        return null



    }

}
export default Nav
